import React, { Component } from 'react';
import styled from 'styled-components';

function ResumeDetailToolbar(props) {
	return (
		<ComponentWrapper>
			<div className="ResumeDetail_ResumeDetail__body__toolbar__lang__W9Txz ResumeDetail_ko__546Fs">
				<i className="icon-ic-language" />
				<select className="ResumeDetail_ResumeDetail__body__toolbar__lang_select__GehjE">
					<option value="ko" selected="">
						한국어
					</option>
					<option value="ja">日本語</option>
					<option value="tw">繁體中文</option>
					<option value="en">English</option>
				</select>
				<i className="icon-cheveron-right" />
			</div>
			<div class="ResumeDetail_ResumeDetail__body__toolbar__otherBtns__ENutv">
				<div class="GuideButton_GuideButton__b8VUj GuideButton_desktop__YbvRO">
					<div class="GuideButton_GuideButton__item__t2_VX">
						<button
							class="Button_Button__root__V1ie3 Button_Button__text__GCOTx Button_Button__textPrimary__hcFzK Button_Button__sizeMedium__k0A1w GuideButton_GuideButton__item_button__Gfk73"
							data-attribute-id="resume__wordGuide"
						>
							<span class="Button_Button__label__1Kk0v">
								합격 / 불합격 단어 가이드
							</span>
						</button>
					</div>
					<div class="GuideButton_GuideButton__item__t2_VX GuideButton_check__DdN8Q">
						<button
							class="Button_Button__root__V1ie3 Button_Button__text__GCOTx Button_Button__textSecondary__xJyp3 Button_Button__sizeMedium__k0A1w GuideButton_GuideButton__item_text__qIKoi"
							data-attribute-id="resume__wordCheck"
							data-toggle="on"
						>
							<span class="Button_Button__label__1Kk0v">
								내 이력서 단어 체크
							</span>
						</button>
						<label class="ToggleButton_ToggleButton__r1gbA GuideButton_GuideButton__item_toggle_btn__XnsVP">
							<input
								class="ToggleButton_ToggleButton_input__5YNX2"
								type="checkbox"
							/>
							<span
								class="ToggleButton_ToggleButton_slider__tXkn6"
								data-attribute-id="resume__wordCheck"
								data-toggle="on"
							></span>
						</label>
					</div>
				</div>
				<button
					type="button"
					class="ResumeDetail_ResumeDetail__body__toolbar__otherBtns_download__n9jwu btn btn-default"
				>
					<i class="icon-download"></i>
				</button>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	width: 1060px;
	margin: 0 auto;
	position: fixed;
	display: flex;
	flex-wrap: nowrap;
	justify-content: space-between;
	background-color: #fff;
	align-items: center;
	top: 50px;
	right: 5%;
	left: 5%;
	z-index: 4;
	padding: 20px 0;

	.ResumeDetail_ResumeDetail__body__toolbar__lang__W9Txz {
		padding: 0;
		height: 40px;
		width: 102px;
		border-radius: 2px;
		border: 1px solid #333;
		background-color: #fff;
		position: relative;
		.icon-ic-language {
			font-size: 18px;
			left: 10px;
		}
	}
	.ResumeDetail_ResumeDetail__body__toolbar__lang_select__GehjE {
		background: none;
		position: relative;
		width: 100%;
		min-width: 98px;
		height: 100%;
		padding-left: 37px;
		border: #e0e0e0;
		background-color: transparent;
		box-shadow: none;
	}
	.icon-cheveron-right {
		right: 0;
		font-size: 18px;
		color: #666;
		position: absolute;
		top: 10px;
	}
`;
export default ResumeDetailToolbar;
